const LoginButton = () => {
    const {loginWithRedirect, isAuthenticated, user } = useAuth0();

    return(
        !isAuthenticated && (
            <button class="text-sm font-semibold leading-6 text-gray-900" onClick={() => loginWithRedirect()}>
                Sign In
            </button>
        )

    )
}

export default LoginButton
